import React from 'react';
import { useLocation } from 'react-router-dom';

const PotorPage=()=> {
  const location = useLocation();
  const receivedData = location.state;

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
  };

  return (
    <div className="slider-container">
      <Slider {...settings}>
        {receivedData.map((profile, index) => (
          <div key={index} className="profile-card">
            <img src={`http://localhost:4000${profile.imageUrl}`} alt={profile.name} />
            <h3>{profile.name}</h3>
          </div>
        ))}
      </Slider>
    </div>
  );
}

export default PotorPage;
